import React, { useState, useEffect } from "react";
import { Form, Button, Container, Table } from "react-bootstrap";
import axios from "axios";
import { LinkContainer, Link } from "react-router-bootstrap";

function DetailResultScreen({ match }) {
  const [product, setProduct] = useState([]);
  //   {
  //     console.log(match);
  //   }
  useEffect(() => {
    async function fetchProduct() {
      const { data } = await axios.get(
        `http://127.0.0.1:8000/api/tasks_ready?id=${match.params.id}?search=${match.params.search}`
      );
      setProduct(data);
    }

    fetchProduct();
  }, []);

  return (
    <div className="result-form">
      <h1>Task Detail</h1>
      <Container>
        {data.length <= 0 ? (
          <h1>No data. Please try again later!</h1>
        ) : (
          <div className="resp-div">
            <h1>Results for {searchSystem} Search</h1>
            {resp.tasks[0].result != null ? (
              <Table striped bordered hover>
                <thead>
                  <tr>
                    <th>ID</th>
                    <th>SE</th>
                    <th>Date Posted</th>
                    <th>Tag</th>
                    <th>Endpoint Regular</th>
                  </tr>
                </thead>
                <tbody>
                  {resp.tasks[0].result.map((rslt) => (
                    <tr>
                      <LinkContainer target="_blank" to="/test">
                        <td className="td-link">{rslt.id}</td>
                      </LinkContainer>
                      <td>{rslt.se}</td>
                      <td>{rslt.date_posted}</td>
                      <td>{rslt.tag}</td>
                      <td>{rslt.endpoint_regular}</td>
                    </tr>
                  ))}
                </tbody>
              </Table>
            ) : (
              <h1>Not found! Please create task!</h1>
            )}
          </div>
        )}
      </Container>
    </div>
  );
}

export default DetailResultScreen;
